package week1.assignments;

public class FindOddNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int maxRange = 25;
		for (int i = 0; i < maxRange; i++) {
			
			if((i%2)!=0) {
				System.out.println(i + " " +" is Odd number");
			}
			
		}

	}

}
